function install(){
var names=['mjpg16','mjpg17','mjpg18A','mjpg18B','mjpg18C','mjpg18D']
var urls=['https://www.googleapis.com/drive/v3/files/1bFWa4-Sys39hCXneKAdoRPUrsfy60eH5?alt=media'
         ,'https://www.googleapis.com/drive/v3/files/1i3B9uUW9fMmZMMN8r77bwL0A2mrkRGOl?alt=media'
         ,'https://www.googleapis.com/drive/v3/files/1SD5kv-52YRgMoyQX7Py_rV-A8dulN-Pk?alt=media'
         ,'https://www.googleapis.com/drive/v3/files/1UQKx7pJ5YjwbnjZlrBnyPLugjJazXV3w?alt=media'
         ,'https://www.googleapis.com/drive/v3/files/17APAqQ_NbAWdMMjD7mFBt4f5i8hbJCzP?alt=media'
         ,'https://www.googleapis.com/drive/v3/files/1B91QPrQ_9kmY5mFWP9_-IoP6QJ5cCZ-g?alt=media']
var xhr=new XMLHttpRequest(),h2=document.querySelector('h2')
xhr.open('GET','https://script.google.com/macros/s/AKfycbwC42_mTmRl9XV5KTrWbU9o2mjAHJC3X_xj2VqEld9iLkGdrrQXI75xQ81V4hlEY473gA/exec?node',false)//讀delicadiesel@gmail.com資料庫的node工作表
xhr.send()
auth=xhr.response.split('\n').pop()
req(0)
function req(i){
var url=urls[i]+'&all'
xhr.open("GET",url,true)//預設為true(異步)
xhr.responseType='blob'
xhr.setRequestHeader('Authorization',auth)
xhr.onprogress=function(e){h2.innerHTML='讀取:'+e.loaded+'<br>全部:'+e.total}
document.querySelector('h3').innerText=names[i]+'→下載中'
xhr.onload=function(){
            caches.open('mjpg').then(function(cache){
            var request=new Request(url+'')
            var response=new Response(xhr.response
                                   //,{status:200,statusText:'OK'
                                   //,headers:{'Content-Type':'application/json',
                                             //'access-control-allow-origin':'https://wbjon.csb.app'
                                             //'content-length':251
                                             //}})
                                     )
            console.log(response)
            document.querySelector('h3').innerText=names[i]+'→快取中'
            cache.put(request,response).then(function(){
                                                        document.querySelector('h1').innerText=names[i]+'→儲存Cache成功'
                                                        i++;if(i<6){req(i)}else{document.querySelector('h3').innerText='地圖安裝完成'}
                                                       })
                                       .catch(function(error){document.querySelector('h1').innerText='儲存Cache失敗：'+error})
            })
           }//onload
xhr.send()
}
}

function delSW(){
 navigator.serviceWorker.getRegistrations()
 .then(function(regs){
        for(const reg of regs){reg.unregister()}
       })
}

const contours=document.getElementById('contours')
step(0)
function step(num){
 let ok=0
 for(let i=num;i<Math.min(num+100,arr.length);i++){
  fetch('https://wbjon.github.io/contours/'+arr[i]).then(res=>{
   ok++;contours.innerText='完成第'+(num+ok)+'個:'+arr[i]
   if(ok==100)step(num+100)
   if(num+ok==arr.length)contours.innerText+='…全部完成'
  })
 }
}
}

var auth,mapJson={},xArr=[],yArr=[],n=0,n200=0,min,max
var jsonUrl='https://www.googleapis.com/drive/v3/files/17w7SgIcs4ufj-qNsvuTnPebG9BYAcEJv?alt=media&.png'//故意加&.png，使其快取
var mjpgUrl='https://www.googleapis.com/drive/v3/files/1fPl7pehBzTeDqcRfu4O_afs2iZezTtkO?alt=media'//利用jsonUrl遍歷mjpgUrl的各tiles
var urlLast=location.href.split('?')[1]
if(urlLast){
  let arr=urlLast.split('&')
  document.getElementById('zoom').value=arr[0]
  document.getElementById('min').value=arr[1]
  document.getElementById('max').value=arr[2]
  start(arr[0])
}

function ready(){
 min=+document.getElementById('min').value;max=+document.getElementById('max').value
 document.querySelectorAll('div')[2].innerText=`預計完成${max-min+1}個`
 if(urlLast){handle(document.getElementById('zoom').value,min)}
}
setInterval(start,300000)
function start(zoom){
 const xhr=new XMLHttpRequest()
 xhr.open('GET','https://script.google.com/macros/s/AKfycbwC42_mTmRl9XV5KTrWbU9o2mjAHJC3X_xj2VqEld9iLkGdrrQXI75xQ81V4hlEY473gA/exec?node',true)//讀delicadiesel@gmail.com資料庫的node工作表
 xhr.send()
 xhr.onload=()=>{
  auth=xhr.response.split('\n').pop()
  if(!zoom){
 //let ele=document.createElement('div')
 //ele.innerText='Authorization更新時間：'+new Date().toLocaleString('zh-TW',{timeZone:'Asia/Taipei'})
 //document.body.append(ele)
   return}
  xArr.length=yArr.length=0;document.querySelectorAll('span')[0].innerText=document.querySelectorAll('span')[1].innerText=document.querySelectorAll('span')[2].innerText=0
  xhr.open('GET',jsonUrl,true)
  xhr.responseType='json'
  xhr.setRequestHeader('Authorization',auth)
  xhr.send()
  xhr.onload=()=>{
   mapJson=xhr.response
   for(let x in mapJson[zoom]){
    for(let y in mapJson[zoom][x])
    {xArr.push(x);yArr.push(y)}
   }
   document.querySelectorAll('div')[1].innerText=`總共${xArr.length}個`
   if(!urlLast){document.getElementById('min').value=0;document.getElementById('max').value=xArr.length-1}
   ready()
  }
 }
}
function handle(zoom,start){//1000個並行
 for(let i=start;i<Math.min(start+1000,max+1,xArr.length);i++){
  if(i>=xArr.length){document.querySelectorAll('span')[0].innerText=n;return}
  const xhr=new XMLHttpRequest()
  xhr.open('GET',mjpgUrl+`&z${zoom}x${xArr[i]}y${yArr[i]}`,true)
  xhr.setRequestHeader('Authorization',auth)
  const bytesRange=`bytes=${mapJson[zoom][xArr[i]][yArr[i]][0]}-${mapJson[zoom][xArr[i]][yArr[i]][1]}`
  xhr.setRequestHeader('Range',bytesRange)
  xhr.send()
  xhr.onerror=function(){console.log('有錯誤');setTimeout(redo,1000)}
  xhr.onload=function(){//console.log(xhr.status);
                        if(xhr.status===200||xhr.status===206){
                         n++;if(xhr.status===200){n200++}
                         document.querySelectorAll('span')[0].innerText=n;document.querySelectorAll('span')[1].innerText=n200;document.querySelectorAll('span')[2].innerText=n-n200
                         if(n%1000==0){
                                     //setTimeout(()=>{handle(zoom,start+1000)},1000)
                                     /*if(!urlLast)*/{location.href=location.href.split('?')[0]+`?${zoom}&${start+1000}&${max}`}
                                      }
                        }
                        else{setTimeout(redo,1000)}
  }
  function redo(){
   xhr.open('GET',xhr.responseURL,true)
   xhr.setRequestHeader('Authorization',auth)
   xhr.send()
  }
 }
}
